-- for mysql
DROP TABLE IF EXISTS `covid19`;
CREATE TABLE IF NOT EXISTS `covid19` (
  `id`   int(11)     NOT NULL     COMMENT 'ID',
  `date` date        DEFAULT NULL COMMENT '日付。YYYY-MM-DD',
  `sex`  int(11)     DEFAULT '0'  COMMENT '性別。|1:男|1:女|0:不明',
  `age`  int(11)     DEFAULT '0'  COMMENT '年齢。|0:1歳未満(男児,女児,幼児,幼児,未就学児)|10歳未満(園児,小学生)|10:10代|20:20代|…|-1:不明',
  `cond` varchar(24) DEFAULT NULL COMMENT '症状',
  `p1`   varchar(8)  DEFAULT NULL COMMENT '都道府県',
  `p2`   varchar(8)  DEFAULT NULL COMMENT '市区町村',
  `job`  varchar(32) DEFAULT NULL COMMENT '職業',
  `jobc` int(11)     DEFAULT '0'  COMMENT '職業カテゴリ。|0:非公表|1:無職|…',
  `cnt`  int(11)     DEFAULT '1'  COMMENT 'カウント',
  PRIMARY KEY (`id`),
  UNIQUE KEY `index1` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

